import { Mail, Notifications, Pets } from "@mui/icons-material";
import { AppBar, Avatar, Badge, Box, InputBase, styled, Toolbar, Typography } from "@mui/material";
import React from "react";

const StyledToolbar = styled(Toolbar)({
    display:"flex",
    justifyContent:"space-between"
});

const Search = styled("div")(({ theme }) => ({
    backgroundColor: "white",
    padding:"0 10px",
    borderRadius: theme.shape.borderRadius,
    width:"40%"
})); 
const Icons = styled(Box)(({ theme }) => ({display:"flex" ,alignItems:"center", gap:"20px"
})); 

const UserBox = styled(Box)

const Navbar = () => {
        return (
            <AppBar position="stick">
                <StyledToolbar>
                    <Typography variant="h6" sx={{display:{xs:"none", sm:"block"}}}>G WEALTH</Typography>
                    <Pets sx={{ display: { xs: "block", sm: "none" } }} />
                    <Search><InputBase placeholder="search..."/></Search>
                    <Icons>
                        <Badge badgeContent={4} color="error">
                        <Mail />
                        </Badge>
                        <Badge badgeContent={2} color="error">
                        <Notifications />
                        </Badge>
                        <Avatar sx={{width:30, height:30}} src="http://images.pexels.com/photos/846741/pexels-photo-846741.jpeg7auto=compress&cs=tinysrgb&w=1260&h=750&dr=2"/>
                        </Icons>
                </StyledToolbar>
            </AppBar>
        );
};

export default Navbar;
